import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./Home";
import Auth from "./Auth"; // Login & Signup Page
import Prediction from "./Prediction"; // Prediction Page
import "./styles.css";

const App = () => {
  return (
    <Router>
      <div className="container">
        <h1 className="main-heading">Alzheimer's Disease Detection</h1>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/auth" element={<Auth />} />
          <Route path="/predict" element={<Prediction />} />
        </Routes>
      </div>
    </Router>
  );
};
const handlePrediction = async () => {
  try {
      const featureValues = Object.values(features).map(value => (value ? Number(value) : 0)); // Convert inputs to numbers
      console.log("Sending features:", featureValues); // Debugging: Check before sending

      const response = await axios.post("http://127.0.0.1:5000/predict", {
          features: featureValues, // Ensure correct key
      });

      console.log("Received Prediction:", response.data);
      setPrediction(response.data.prediction);
  } catch (error) {
      alert("Prediction failed. Check the inputs and try again.");
  }
};


export default App;
